import React, { Component } from "react";
import "../style/style.css";

export class footer extends Component {
  render() {
    return (
      <footer>
        <div></div>
        <nav>
          <ul>
            <li>
              <a href="#">MENU</a>
            </li>
            <li>
              <a href="#">SOME TEXT</a>
            </li>
            <li>
              <a href="#">ANOTHER ITEM</a>
            </li>
            <li>
              <a href="#">ONE MORE</a>
            </li>
            <li>
              <a href="#">AND LAST ONE</a>
            </li>
          </ul>
        </nav>
      </footer>
    );
  }
}

export default footer;
